import React from 'react';
import s from './Navbar.module.css';
import {NavLink} from "react-router-dom";

const Navbar = () => {
    return(
        <nav className={s.nav}>
        <div className={s.item}>
                <NavLink to='/Profile' activeClassName={s.active}>Profile</NavLink>
            </div> 
        <div className={s.item}>
            <NavLink to="/News" activeClassName={s.activeLink}>News</NavLink></div>
        <div className={s.item}><NavLink to="/Friends" activeClassName={s.active}>Friends</NavLink></div>
        <div className={s.item}><NavLink to="/Photo" activeClassName={s.active}>Photo</NavLink></div>
        <div className={s.item}><NavLink to="/Dialogs" activeClassName={s.active}>Message</NavLink></div>
        <div className={s.item}><NavLink to="/Settings" activeClassName={s.active}>Settings</NavLink></div>
    </nav> 
    )
}

export default Navbar;
